Non so se faccia più ridere il mio sorriso forzato nel vano tentativo di scattarmi un selfie decente, o il piccione sopra di me che sembra stia per cagarmi in testa.

In ogni caso questa settimana al #MWC di #Barcellona è stata una soddisfazione dopo l'altra ❤️ #shotonmi9 #miexplorers #detailsmattertomi
